INSERT INTO `questions` VALUES(10, 'systems', 'elec', '9.1.5', 'mc', 'That the GPU is plugged in with some power available.', '', '', 'The aircraft electrical system is powered.', 'The ground power unit is disconnected from the aircraft.', 'The ground air supply is supplying bleed air to the packs.', 'The GPU AVAIL inscription on the GPU button indicates:', '');
