INSERT INTO `questions` VALUES(40, 'systems', 'autopilot', '9.1.19', 'mc', '90', '', '', '70', '100', '45', 'After having been cleared for the approach, the approach mode can be activated within ___ degrees for a front course approach.', 'The aircraft heading must be within ___ degrees of the final approach course (front course) prior to selecting the APR or NAV mode.');
INSERT INTO `questions` VALUES(41, 'systems', 'autopilot', '9.1.19', 'mc', 'VS mode but with preset vertical speeds', '', '', 'SPD mode but with preset speeds.', 'VS and SPD mode. It maintains 290 KIAS from FL370 down to 10,000 then 1000ft/min.', 'PIT mode.  It maintains 5 degrees nose down from FL370 down to FL180 then linearly increases pitch to 3 degrees nose down.', 'During descent, FLC works just like:', 'The flight-guidance DES mode is programmed to function like: ');
