INSERT INTO `questions` VALUES(43, 'systems', 'autopilot', '9.1.19', 'c2', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', '', '14 degrees pitch up attitude (Flaps 18).', '', '', 'On the ground, pressing the TOGA buttons will position the command bars to:', 'Arming the TO vertical flight guidance mode will position the command bars to:');
