INSERT INTO `usedQuestions` VALUES(121, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'The Enhanced Emergency Master Kit (EEMK)', 'a');
