INSERT INTO `usedQuestions` VALUES(122, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'All three bleed valves must be closed.', 'The engine bleed valves must be open.', 'The engine thrust must be at a minimum of 83% N1.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'b');
INSERT INTO `usedQuestions` VALUES(122, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'c');
