INSERT INTO `usedQuestions` VALUES(123, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(123, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air entering the pack is too hot.', 'The air entering the compressor is too hot.', 'The air leaving the compressor is too hot.', 'The air leaving the pack is too hot.', 'd');
