INSERT INTO `usedQuestions` VALUES(128, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV BOTTLE INOP EICAS warning appears.', 'The LAV SMOKE EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd');
