INSERT INTO `usedQuestions` VALUES(128, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Fails closed (OFF) in essential power.', 'Cannot be activated unless ice is detected.', 'Uses bleed air from the 9th stage of the compressor.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(128, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Is on and cannot be turned off.', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'Is not available.', 'Is available with the override switch in ALL.', 'c');
