INSERT INTO `usedQuestions` VALUES(128, 182, 'mc', 'ldg_gear_brk', 'The emergency brake provides:', 'Locked wheel protection, but not touchdown protection.', 'No anti-skid protection.', 'Anti-skid protection only.', 'None of the above.', 'b');
