INSERT INTO `usedQuestions` VALUES(129, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'As soon as the electrical system is powered.', 'By a 5G impact or immersion in water.', 'By turning on the navigation lights.', 'By turning on the red beacon.', 'a');
INSERT INTO `usedQuestions` VALUES(129, 58, 'tf', 'crew_awareness', 'The flight attendant can override the cockpit switch and turn the emergency lights on, regardless of the emergency light switch position in the cockpit.', 'TRUE', 'FALSE', '', '', 'a');
