INSERT INTO `usedQuestions` VALUES(135, 119, 'mc', 'flt_control', 'The electromechanical gust lock inserts locking pins into:', 'Elevator', 'Rudder.', 'Inboard spoilers while in flight.', 'Ailerons.', 'a');
