INSERT INTO `usedQuestions` VALUES(135, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'One wing tank reaches 4630 lbs + 30 seconds.', 'The FMS shows fuel remaining on arrival of less than 1800 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'c');
