INSERT INTO `usedQuestions` VALUES(135, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'Turn the pump in the low tank off.', 'a');
INSERT INTO `usedQuestions` VALUES(135, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'Fuel is used from the ventral tank first, then from the wings.', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'a');
INSERT INTO `usedQuestions` VALUES(135, 140, 'mc', 'fuel', 'In essential power:', 'Only the A and B fuel boost pumps are available.', 'No fuel boost pumps are available.', 'All fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'a');
INSERT INTO `usedQuestions` VALUES(135, 155, 'mc', 'hydraulics', 'In essential power, the electric hydraulic pumps are:', 'Only the #2 pump is available for the emergency brakes.', 'Both available.', 'Only the #1 pump is available for landing gear extension.', 'Not available.', 'd');
