INSERT INTO `usedQuestions` VALUES(135, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Freefall', 'Are held up by a mechanical uplock.', 'Extend normally using the gear handle.', 'Are held up by system 1 accumulator pressure.', 'a');
INSERT INTO `usedQuestions` VALUES(135, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The engine bleeds should be selected open.', 'The use of packs is only permitted if the APU bleed is available.', 'Pack 1 is off, Pack 2 is on.', 'The engines bleeds will always be closed.', 'a');
