INSERT INTO `usedQuestions` VALUES(136, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'The cross-side AHRS automatically takes over.', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'ATT FAIL appears on the EADI on the PFD.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'IAS displayed on each PFD differs by more than 5 knots.', 'Altitude displayed on each PFD differs by more than 200 feet.', 'A disagreement between IC-600''s on EICAS messages displayed.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 59, 'tf', 'crew_awareness', 'The TBCH is the only means of tuning NAV2 in essential power.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(136, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Is automatically displayed on RMU 1', 'Can be presented by using SG reversion.', 'Is powered normally.', 'Can be presented by using MFD reversion.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'The heading system has failed.', 'A difference of 6 degrees between the left and right AHRS headings.', 'Check your heading, you''re drifting from the assigned heading.', 'The FMS is suggesting heading select navigation.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main and service doors.', 'Main cabin door only.', 'Over-wing emergency exit.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR-DME approaches can be flown using the standby instruments.', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'VOR approaches are impossible since the PFD is blank.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and FADECs.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Allows a test of the ISIS on LR aircraft.', 'Opens the BBC, isolating the backup battery hot bus.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Removes power from the backup flight instruments.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 11, 'mc', 'elec', 'Which components are energized in essential power configuration?', 'DC bus 1 and DC bus 2', 'All electrical busses except the shed busses.', 'The hot battery busses, essential busses, and the central DC bus.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered.', 'All DC buses are powered except the shed buses.', 'Only the esential buses can be powered.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'Essential bus 2.', 'DC bus 2.', 'Backup hot bus.', 'Central DC bus.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You have one electrical system despite having 4 or more generators on-line.', 'Is normal during a loss of all generators.', 'You are in essential power configuration but should not be.', 'You are not in the essential power configuration but should be.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(136, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(136, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'EGPWS/Wind Shear.', 'Weather Radar.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'c');
INSERT INTO `usedQuestions` VALUES(136, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 104, 'mc', 'fire_prot', 'When a fire extinguishing handle is pulled:', 'The hydraulic shutoff valve is opened.', 'The engine will not shut down unless the thrust lever is in idle.', 'The fuel shutoff valve closes.', 'The respective engine fire bottle is discharged.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '3', '1', '0', '2', 'a');
INSERT INTO `usedQuestions` VALUES(136, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'APU fire detection and protection is available in essential power.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(136, 116, 'mc', 'flt_control', 'In essential power, the flaps:', 'Will not operate.', 'Will operate at half speed.', 'Are operative under manual reversion.', 'Operate normally.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 128, 'mc', 'flt_control', 'During normal cruise flight, the rudder Power Control Unit receives hydraulic pressure from:', 'Hydraulic system 2.', 'Essential DC bus.', 'Hydraulic system 1.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'The speedbrake lever has to be selected to OPEN.', 'The flap lever has to be at 0 or 9 degrees.', 'A low TLA (thrust lever angle).', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 122, 'mc', 'flt_control', 'The speedbrakes do not open if:', 'The gear is down.', 'The flaps are extended to 22 degrees.', 'Hydraulic system 1 fails.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'Fuel is used from the ventral tank first, then from the wings.', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 140, 'mc', 'fuel', 'In essential power:', 'No fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'De-energizing the boost pumps in tank 1.', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 2.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'The FMS shows fuel remaining on arrival of less than 1800 lbs.', 'One wing tank reaches 1863 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 138, 'mc', 'fuel', 'If the fuel boost pump fails:', 'The engine will continue to run, but at reduced thrust.', 'The engine will continue to run by suction feed through a check valve.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 153, 'mc', 'hydraulics', 'Hydraulic system temperature can be monitored on the:', 'The MFD hydraulic page for system 1 only.', 'Cannot be monitored.', 'MFD hydraulic page.', 'EICAS.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Extend normally using the gear handle.', 'Freefall', 'Are held up by a mechanical uplock.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Ailerons and rudder should all pressure be lost.', 'Nosewheel steering.', 'Emergency brakes.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Emergency brakes only, supplying 6 applications.', 'Inboard spoilers, outboard brakes, landing gear.', 'Emergency brakes only, unlimited applications.', 'Outboard spoilers, inboard brakes, emergency brakes.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'MFD ECS/AI page.', 'EICAS.', 'The RMU Engine page 1.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 174, 'mc', 'ice_rain_prot', 'Which statement is true regarding the operation of the clear ice detection on an XRJ?', 'On the ground only, when clear ice is present on the wing.', 'On the ground or in flight when clear ice is present on the wing.', 'In flight only, when clear ice is present on the wing.', 'XRJ''s are not equipped with clear ice detectors.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 169, 'mc', 'ice_rain_prot', 'When taxiing in icing conditions:', 'The APU bleed air can be used for air conditioning.', 'The APU bleed can be used but only for a single engine taxi, since it is on the left side of the system.', 'The engines bleeds must be open for anti-ice.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 171, 'mc', 'ice_rain_prot', 'Ice test A requires:', 'Override to ALL, test switch for 10 seconds minimum.', 'Override to AUTO.', 'The override to ENG/test switch held for 20 seconds in each position.', 'Override to AUTO for a minimum of 10 seconds, maximum 30 seconds.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 159, 'mc', 'ice_rain_prot', 'When is the ice protection penalty on the runway analysis required?', 'Visibility 1 & 1/2 SM and 15 degrees Celsius.', 'Clear skies and 2 degrees Celsius.', 'Rain and 20 degrees Celsius.', '1000'' overcast and 12 degrees Celsius.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'During a bleed overtemp.', 'On the ground with a wheel speed at or below 25 kts.', 'With the FADEC Ref. anti-ice selected OFF.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 183, 'mc', 'ldg_gear_brk', 'In essential power, nosewheel steering:', 'Operates normally.', 'Operates normally, but only above 10 knots.', 'Is not available.', 'Is available, but with limited capability.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 179, 'mc', 'ldg_gear_brk', 'The landing gear is normally help up ___ and extended ___.', 'Hydraulically, Mechanically.', 'Mechanically, Mechanically.', 'Mechanically, hydrualically.', 'Hydrualically, hydrualically.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 189, 'mc', 'ldg_gear_brk', 'Nosewheel steering utilizes:', 'Hydraulic system 1.', 'Both hydraulic systems.', 'Is electropneumatic.', 'Hydraulic system 2.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'Essential bus.', 'Dedicated batteries.', 'DC bus.', 'Photo luminescent; no power source required.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 196, 'mc', 'lighting', 'The emergency lights:', 'Can only be turned on manual.y by the flight attendant.', 'Drain the main batteries so they should be turned off in an emergency.', 'Automatically come on when normal electrical power is lost.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS below 10,000 feet.', '250 KIAS or MACH .63, whichever is higher.', '250 KIAS or MACH .63, whichever is lower.', '200 KIAS.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 208, 'mc', 'limitations', 'What is the minimum oil temperature required to increase N2 above 83%?', '40 degrees C.', '20 degrees F.', '20 degrees C.', '40 degrees F.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 45 C.', 'ISA + 25 C.', 'ISA + 35 C.', 'ISA + 15 C.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 287, 'mc', 'limitations', 'Can an engine start be allowed to continue if the oil pressure is in the amber range?', 'Yes - if the oil temperature is less than 21 C.', 'Yes - oil pressure limitations only apply during the takeoff phase.', 'No - this is an abnormal condition and the start should be aborted regardless of temperature.', 'Yes - if the ITT is more than 600 C.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL410.', 'FL450.', 'FL 370.', 'FL350.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Pitch systems 1 & 2 off.', 'Quick disconnect button, press and hold.', 'Control column hold firmly.', 'Actuate the pitch trim switch in the opposite direction.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-30 C.', '-45 C with momentary deviations to -50 C permitted.', '-52 C.', '-65 C.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes.', 'Yes, provided the flight crew advises ATC.', 'Only if the crossfeed is on.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 213, 'mc', 'limitations', 'The maximum static air temperature (SAT) at FL370 is ___.', '35 C.', '9 C.', '-21.5 C.', '-65 C.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL350.', 'FL370.', 'FL200.', 'FL300.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 231, 'mc', 'oxy', 'In the XR with passenger oxygen masks in AUTO, the oxygen masks drop at:', '14,000'' MSL.', '14,500'' +/- 500 cabin altitude.', '14,000'' AGL.', '10,000'' cabin altitude.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 228, 'mc', 'oxy', 'The OXYGEN LOW PRESS message appears on the EICAS when:', 'Oxygen masks have dropped when they should not have.', 'Approximately 30 minutes of crew oxygen remains.', 'The oxygen pressure is at or below 400 psi.', 'The passenger oxygen is below 550 psi.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'Air after the compressor is too hot.', 'A massive leak detector has detected a bleed leak.', 'The air leaving the pack is too hot.', 'Air leaving the pre-cooler is too hot.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'CLOSED, closed.', 'AUTO, closed.', 'OPEN, open.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'No line, no open inscription.', 'Open inscription, no line.', 'A line, no OPEN inscription.', 'A line and an OPEN inscription.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'All bleeds open, PACKs on, cross bleed open.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'The engine bleed valve should automatically close.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'TO, ETO, TO RSV.', 'ETO, TO RSV, ETO RSV.', 'ALT TO, TO, ETO.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The PMA, only above 10% N2.', 'The essential buses.', 'The PMA, only above 50% N2.', 'The FADEC itself.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engines shuts down.', 'Engine page 1 automatically appears on RMU1.', 'FADEC "A" automatically takes over.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The other FADEC (same engine) immediately takes over.', 'The engine runs in idle until the pilot resets the FADEC.', 'The engine shuts down and may be restarted after alternating FADECs.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', 'Immediately after IGN is displayed on the EICAS.', '56.4 percent N2.', '12-14 percent N2.', 'Approximately 30 percent N2.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'Shut the engine down immediately and call maintenance.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 254, 'tf', 'powerplant', 'Do not abort the takeoff if oil pressure increases from the green to the amber range:', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(136, 260, 'mc', 'powerplant', 'The FADECs receive electrical power from:', 'The PMA only.', 'The essential buses during an electrical emergency.', 'The essential buses.', 'The essential buses or the PMA depending on N2 RPM.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 265, 'mc', 'powerplant', 'Which is not an item in the engine''s accessory gear box?', 'Oil pump.', 'Ejector pump.', 'Engine driven generator.', 'Hydraulic pump.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately after the PACKs are selected during the after takeoff flow.', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'a');
INSERT INTO `usedQuestions` VALUES(136, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '14,000'' +/- 500''.', '25,000''.', '24,600''.', '1700'' AGL.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Will depressurize up to FL370.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 290, 'mc', 'profiles', 'When is takeoff thrust no longer needed on a normal takeoff?', 'Anytime after the crew feels that they have cleared all obstacles in the departure path.', 'When the PM presses the FLC button on the Flight Guidance Control Panel.', 'After radar contact has been established.', 'Once acceleration height and Vfs have been reached.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'GMAP mode is only available during ground operations.', 'Increasing gain increases receiver sensitivity.', 'Increasing gain increases the energy output from the antenna.', 'The radar cannot be used on the ground.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(136, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'If the airspeed is less than 200 kts.', 'If the SPS/ICE SPEEDs message is displayed.', 'During an SPS test.', 'If one channel of the SPS is inoperative.', 'd');
INSERT INTO `usedQuestions` VALUES(136, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'BAGG SMOKE', 'E1(2) EXTBL A(B) INOP', 'LAV SMOKE', 'APU Fire Loop Fail', 'a');
INSERT INTO `usedQuestions` VALUES(136, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'd');
INSERT INTO `usedQuestions` VALUES(136, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to ON, 1600 psi.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'c');
INSERT INTO `usedQuestions` VALUES(136, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'Select "Mask" on the DAP, twist to Emergency.', 'The crew must ensure that no passengers are on board.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'a');
INSERT INTO `usedQuestions` VALUES(136, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine bleed valves must be open.', 'All three bleed valves must be closed.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air leaving the pack is too hot.', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The air entering the compressor is too hot.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'B and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Overwing emergency exit.', 'Baggage compartment door.', 'Under cockpit access hatch.', 'Forward nose hydraulic compartment.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '70 C', '54 C', '-20 C', '40 C', 'c');
INSERT INTO `usedQuestions` VALUES(137, 32, 'mc', 'apu', 'In case of an APU fire, the APU shuts down:', 'After 10 seconds on the ground.', 'After 10 seconds on the ground, immediately in flight.', 'Immediately in flight.', 'Immediately at all times.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The quick disconnect button', 'The "AP" button on the Flight Guidance Control Panel', 'Use of pitch trim', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 40, 'mc', 'autopilot', 'After having been cleared for the approach, the approach mode can be activated within ___ degrees for a front course approach.', '100', '45', '70', '90', 'd');
INSERT INTO `usedQuestions` VALUES(137, 38, 'mc', 'autopilot', 'During climb, FLC works just like:', 'SPD with preset values below 10,000'' and VS with preset values above 10,000''.', 'SPD but with preset speeds.', 'PIT but with preset attitudes.', 'VS but with preset vertical speeds.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 50, 'mc', 'autopilot', 'On LR aircraft above 12,000 in FLC, the aircraft climbs at...', '290 KIAS until MACH 0.56', '2000 fpm', '270 KIAS until MACH 0.65', '270 KIAS until MACH 0.56', 'd');
INSERT INTO `usedQuestions` VALUES(137, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'FMS', 'HDG, then FMS.', 'HDG', 'NAV', 'd');
INSERT INTO `usedQuestions` VALUES(137, 85, 'mc', 'crew_awareness', 'How do the 5 cockpit CRTs appear following the loss of DC Bus 2?', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'PFD 2 and MFD 2 are blank.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 63, 'tf', 'crew_awareness', 'Should the need arise, COM 3 is available for voice communication.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(137, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'A red failure indications appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The standby airspeed indicator becomes unreliable.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'Airspeed will be covered with hash marks', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'ATT FAIL appears on the EADI on the PFD.', 'The cross-side AHRS automatically takes over.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(137, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(137, 81, 'mc', 'crew_awareness', 'The power source for SG 2 is:', 'DC Bus 2', 'Essential bus 1', 'Essential bus 2', 'DC bus 1', 'a');
INSERT INTO `usedQuestions` VALUES(137, 61, 'mc', 'crew_awareness', 'The flight data recorder is activated (starts recording):', 'By a 5G impact or immersion in water.', 'By turning on the NAV lights.', 'By turning on the red beacon', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'The heading system has failed.', 'Check your heading, you''re drifting from the assigned heading.', 'The FMS is suggesting heading select navigation.', 'A difference of 6 degrees between the left and right AHRS headings.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot/Static tube 3', 'Pitot 2/Static ports 2 & 3.', 'Pitot 1/Fadec pressurization static port.', 'Pitot 1/Static ports 1 & 4.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Roll trim.', 'Flaps.', 'Normal gear extension.', 'Pressurization.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and FADECs.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 76, 'mc', 'elec', 'The ELT battery:', 'Is charged by the esential busses', 'Is charged only when the ELT switch is in the ARM position.', 'Is not charged.', 'Is charged by the shed buses', 'c');
INSERT INTO `usedQuestions` VALUES(137, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'Only the esential buses can be powered.', 'All DC buses are powered if the shed bus knob is in OVRD.', 'All DC buses are powered.', 'All DC buses are powered except the shed buses.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BTC 1 & 2 are open.', 'BC 1 and BC 2 are open.', 'The ALC is closed if the APU has been started.', 'BC 1 and BC 2 are closed.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Removes power from the backup flight instruments.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Allows a test of the ISIS on LR aircraft.', 'Opens the BBC, isolating the backup battery hot bus.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 90, 'tf', 'elec', 'The ground service bus is only powered with an available GPU NOT selected and the batteries OFF.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(137, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(137, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'Is normal during a loss of all generators.', 'You are in essential power configuration but should not be.', 'You have one electrical system despite having 4 or more generators on-line.', 'You are not in the essential power configuration but should be.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'Weather Radar.', 'TCAS.', 'EGPWS/Wind Shear.', 'B and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV BOTTLE INOP EICAS warning appears.', 'The LAV SMOKE EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '1 Halon fire bottle for the lavatory waste basket', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '2', '1', '0', '3', 'd');
INSERT INTO `usedQuestions` VALUES(137, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The engine bleed and lip anti-ice ice valves.', 'The fuel shutoff valve.', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The deflection is 5 degrees +/- 1 degree.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'The rudder is in manual reversion.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 119, 'mc', 'flt_control', 'The electromechanical gust lock inserts locking pins into:', 'Ailerons.', 'Elevator', 'Rudder.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(137, 123, 'mc', 'flt_control', 'Elevator trim is accomplished by:', 'Positioning the elevator with the main or backup trim switches.', 'Positioning the horizontal stabilizer.', 'Positioning the spring and fixed tabs on the trailing edges of the elevator.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 118, 'mc', 'flt_control', 'When using speedbrakes in flight:', 'The outboard spoilers deploy using hydraulic system 1 pressure.', 'The inboard and outboard spoilers deploy using both systems.', 'The inboard spoilers deploy using hydraulic system 1 pressure.', 'The outboard spoilers deploy using hydraulic system 2 pressure.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 133, 'mc', 'fuel', 'The fuel temperature on the MFD is measured at:', 'The ACOC.', 'The left fuel tank.', 'Each fuel tank.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'Fuel is used from the ventral tank first, then from the wings.', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 138, 'mc', 'fuel', 'If the fuel boost pump fails:', 'The engine will eventually flame out due to lack of fuel.', 'The engine will continue to run, but at reduced thrust.', 'The engine will continue to run by suction feed through a check valve.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 141, 'tf', 'fuel', 'The fuel crossfeed valve automatically closes in essential power.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(137, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The flaps will not extend.', 'The landing gear retracts normally.', 'The flaps operate normally.', 'The landing extends normally.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Turns on the electric pump regardless of system pressure.', 'Places the electric hydraulic pump in a standby condition.', 'Turns on the electric pump only if the engine is shut down.', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '1600 psi.', '3000 psi.', '2900 psi.', '1200 psi.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Freefall', 'Extend normally using the gear handle.', 'Are held up by a mechanical uplock.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Both hydraulic systems.', 'Hydraulic system 2 only, when above 135 KIAS.', 'Hydraulic system 1 only.', 'Hydraulic system 2 only.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'During a bleed overtemp.', 'They are never inhbited.', 'On the ground with a wheel speed at or below 25 kts.', 'With the FADEC Ref. anti-ice selected OFF.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 159, 'mc', 'ice_rain_prot', 'When is the ice protection penalty on the runway analysis required?', 'Visibility 1 & 1/2 SM and 15 degrees Celsius.', 'Rain and 20 degrees Celsius.', '1000'' overcast and 12 degrees Celsius.', 'Clear skies and 2 degrees Celsius.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 160, 'mc', 'ice_rain_prot', 'When is engine lip anti-ice required?', 'Whenever the temperature is 10 C or less and visible moisture is present.', 'Whenever visible moisture is present.', 'Whenever the temperature is 10 C or less.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Fails closed (OFF) in essential power.', 'Uses bleed air from the 9th stage of the compressor.', 'Cannot be activated unless ice is detected.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 158, 'mc', 'ice_rain_prot', 'The SPS/ICE SPEEDS EICAS message is cleared:', 'Once the aircraft exits icing conditions.', 'By pressing the SPS test button at any time.', 'By pressing the quick disconnect button.', 'By pressing the SPS test button (on the ground only).', 'd');
INSERT INTO `usedQuestions` VALUES(137, 192, 'mc', 'ldg_gear_brk', 'What parameters allow us to cancel a landing gear aural warning message?', '<1200'' AGL, low thrust lever angle, flaps 0-22.', 'RA inop, low thrust lever angle, flaps 0-18.', 'Any thrust lever, RA inop, flaps 22.', 'Any thrust lever angle, flaps 45.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 183, 'mc', 'ldg_gear_brk', 'In essential power, nosewheel steering:', 'Operates normally.', 'Operates normally, but only above 10 knots.', 'Is not available.', 'Is available, but with limited capability.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 189, 'mc', 'ldg_gear_brk', 'Nosewheel steering utilizes:', 'Hydraulic system 1.', 'Both hydraulic systems.', 'Is electropneumatic.', 'Hydraulic system 2.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 200, 'mc', 'lighting', 'The emergency light batteries are charged with normal power established on the aircraft and when the emergency light switch is in the:', 'ARM position.', 'OFF position.', 'Are not charged and replaced periodically by maintenance.', 'ON position.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 199, 'mc', 'lighting', 'Aisle path lighting in the XR consists of:', 'Red and white lights powered by the backup battery.', 'There is no aisle path lighting.', 'Photo luminescent lighting.', 'A steady set of green lights powered by DC bus 1.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL350.', 'FL370.', 'FL200.', 'FL300.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 287, 'mc', 'limitations', 'Can an engine start be allowed to continue if the oil pressure is in the amber range?', 'No - this is an abnormal condition and the start should be aborted regardless of temperature.', 'Yes - if the oil temperature is less than 21 C.', 'Yes - oil pressure limitations only apply during the takeoff phase.', 'Yes - if the ITT is more than 600 C.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '300 amps.', '350 amps.', '400 amps.', '250 amps.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Control column hold firmly.', 'Quick disconnect button, press and hold.', 'Pitch systems 1 & 2 off.', 'Actuate the pitch trim switch in the opposite direction.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '250 knots.', '180 knots.', '200 knots.', '240 knots.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Only if the crossfeed is on.', 'Yes, provided the flight crew advises ATC.', 'No.', 'Yes.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 15 C.', 'ISA + 35 C.', 'ISA + 45 C.', 'ISA + 25 C.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 213, 'mc', 'limitations', 'The maximum static air temperature (SAT) at FL370 is ___.', '9 C.', '35 C.', '-65 C.', '-21.5 C.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 215, 'mc', 'limitations', 'What is VLE?', '250 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', '180 knots.', '200 knots.', 'a');
