INSERT INTO `usedQuestions` VALUES(137, 228, 'mc', 'oxy', 'The OXYGEN LOW PRESS message appears on the EICAS when:', 'The oxygen pressure is at or below 400 psi.', 'Oxygen masks have dropped when they should not have.', 'Approximately 30 minutes of crew oxygen remains.', 'The passenger oxygen is below 550 psi.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 230, 'tf', 'oxy', 'When the passenger masks fall, the oxygen flow starts without the passengers taking any action.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(137, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 247, 'mc', 'pneum', 'When will the crossbleed valve open automatically when in the "AUTO" position?', 'Anytime the ICE CONDITION EICAS message is displayed.', 'During a cross-bleed start.', 'During ice test A.', 'When the override knob on the ice protection panel is in ENG.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'b');
