INSERT INTO `usedQuestions` VALUES(137, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'The engine bleed valve should automatically close.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'Air leaving the pre-cooler is too hot.', 'Air after the compressor is too hot.', 'The air leaving the pack is too hot.', 'A massive leak detector has detected a bleed leak.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'There is no automatic reaction.', 'The thrust reverser stows automatically.', 'The FADEC reduces the thrust to idle automatically.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 255, 'mc', 'powerplant', 'The A1/E engines are limited to ___ ITT.', '901 continuous.', '992 C for 90 seconds and up to 970 C for 5 minutes.', '880 for starting.', '948 C.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 24, 'ac', 'powerplant', 'The engine has:', 'A 14 stage compressor.', 'A 2 stage high-pressure turbine.', '6 stages of CVG vanes.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'EICAS.', 'MFD takeoff page.', 'RMU maintenance page.', 'MFD Hydraulic page.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engines shuts down.', 'FADEC "A" automatically takes over.', 'Engine page 1 automatically appears on RMU1.', 'The engine reverts to N1SYN mode.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'Shut the engine down immediately and call maintenance.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine runs in idle until the pilot resets the FADEC.', 'The other FADEC (same engine) immediately takes over.', 'The engine shuts down and may be restarted after alternating FADECs.', 'The engine shuts down.', 'b');
