INSERT INTO `usedQuestions` VALUES(137, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '24,600''.', '25,000''.', '14,000'' +/- 500''.', '1700'' AGL.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'Immediately after the PACKs are selected during the after takeoff flow.', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the ADCs.', 'Provide static information to the CPAM.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'a');
