INSERT INTO `usedQuestions` VALUES(137, 288, 'mc', 'radar', 'Which mode of the radar can be used to depict potential radar ''shadows''?', 'STAB', 'DG', 'RCT', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'When the low speed awareness tape is in the amber range.', 'At 130 KIAS.', 'When the aircraft symbol touches the PLI.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(137, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'c');
INSERT INTO `usedQuestions` VALUES(137, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'b');
INSERT INTO `usedQuestions` VALUES(137, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'E1(2) EXTBL A(B) INOP', 'BAGG SMOKE', 'LAV SMOKE', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(137, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine bleed valves must be open.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'All three bleed valves must be closed.', 'The engine thrust must be at a minimum of 83% N1.', 'a');
INSERT INTO `usedQuestions` VALUES(137, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, twist to Emergency.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'a');
INSERT INTO `usedQuestions` VALUES(138, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd');
