INSERT INTO `usedQuestions` VALUES(138, 32, 'mc', 'apu', 'In case of an APU fire, the APU shuts down:', 'After 10 seconds on the ground.', 'Immediately at all times.', 'After 10 seconds on the ground, immediately in flight.', 'All of the above.', 'a');
