INSERT INTO `usedQuestions` VALUES(138, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', '14 degrees pitch up attitude (Flaps 18).', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(138, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(138, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By turning on the navigation lights.', 'By turning on the red beacon.', 'By a 5G impact or immersion in water.', 'As soon as the electrical system is powered.', 'd');
