INSERT INTO `usedQuestions` VALUES(138, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'Check your heading, you''re drifting from the assigned heading.', 'The heading system has failed.', 'The FMS is suggesting heading select navigation.', 'A difference of 6 degrees between the left and right AHRS headings.', 'd');
