INSERT INTO `usedQuestions` VALUES(138, 149, 'mc', 'hydraulics', 'The priority valve in hydraulic system 1 provides:', 'Ensures hydraulic pressure to the landing gear when operating on the electric hydraulic pump.', 'Restricts hydraulic presure from the landing gear to the ensure pressure for the flight controls.', 'Allows hydraulic system 2 to assist hydraulic system 1 in low pressure situations.', 'All of the above.', 'b');
