INSERT INTO `usedQuestions` VALUES(151, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '1 Halon fire bottle for the lavatory waste basket', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(151, 122, 'mc', 'flt_control', 'The speedbrakes do not open if:', 'The thrust levers are in idle.', 'The flaps are extended to 22 degrees.', 'Hydraulic system 1 fails.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(151, 118, 'mc', 'flt_control', 'When using speedbrakes in flight:', 'The outboard spoilers deploy using hydraulic system 1 pressure.', 'The outboard spoilers deploy using hydraulic system 2 pressure.', 'The inboard and outboard spoilers deploy using both systems.', 'The inboard spoilers deploy using hydraulic system 1 pressure.', 'b');
INSERT INTO `usedQuestions` VALUES(151, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'The flap lever has to be at 0 or 9 degrees.', 'The speedbrake lever has to be selected to OPEN.', 'A low TLA (thrust lever angle).', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(151, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a mis-threading of the ball-screw actuator.', 'Indicates a failure of the teleflex cable.', 'Indicates a flap motor failure.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(151, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'The rudder is in manual reversion.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The deflection is 5 degrees +/- 1 degree.', 'c');
INSERT INTO `usedQuestions` VALUES(151, 141, 'tf', 'fuel', 'The fuel crossfeed valve automatically closes in essential power.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(151, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 1.', 'De-energizing the boost pumps in tank 1.', 'De-energizing the boost pumps in tank 2.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(151, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'The FMS shows fuel remaining on arrival of less than 1800 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'b');
INSERT INTO `usedQuestions` VALUES(151, 138, 'mc', 'fuel', 'If the fuel boost pump fails:', 'The engine will continue to run by suction feed through a check valve.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will eventually flame out due to lack of fuel.', 'The engine will continue to run, but at reduced thrust.', 'b');
INSERT INTO `usedQuestions` VALUES(151, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'd');
INSERT INTO `usedQuestions` VALUES(151, 153, 'mc', 'hydraulics', 'Hydraulic system temperature can be monitored on the:', 'The MFD hydraulic page for system 1 only.', 'Cannot be monitored.', 'MFD hydraulic page.', 'All of the above.', 'b');
