INSERT INTO `usedQuestions` VALUES(151, 151, 'mc', 'hydraulics', 'Hydraulic system 1 provides pressure to:', 'The inboard flaps.', 'The rudder above 135 KIAS.', 'The parking brake.', 'The nose-wheel steering.', 'd');
INSERT INTO `usedQuestions` VALUES(151, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Hydraulic system 2 only, when above 135 KIAS.', 'Hydraulic system 1 only.', 'Both hydraulic systems.', 'Hydraulic system 2 only.', 'c');
