INSERT INTO `usedQuestions` VALUES(151, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'On and cannot be turned off.', 'Comes from the 9th stage of the compressor only.', 'Not available.', 'Available if selected on or in icing conditions.', 'a');
