INSERT INTO `usedQuestions` VALUES(151, 159, 'mc', 'ice_rain_prot', 'When is the ice protection penalty on the runway analysis required?', 'Visibility 1 & 1/2 SM and 15 degrees Celsius.', '1000'' overcast and 12 degrees Celsius.', 'Clear skies and 2 degrees Celsius.', 'Rain and 20 degrees Celsius.', 'b');
INSERT INTO `usedQuestions` VALUES(151, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'On the ground with a wheel speed at or below 25 kts.', 'During a bleed overtemp.', 'They are never inhbited.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(151, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The vertical stabilizer is heated.', 'No ice test is needed.', 'The XR has boots.', 'There are clear ice-detectors on the wings.', 'd');
INSERT INTO `usedQuestions` VALUES(151, 192, 'mc', 'ldg_gear_brk', 'What parameters allow us to cancel a landing gear aural warning message?', 'Any thrust lever angle, flaps 45.', '<1200'' AGL, low thrust lever angle, flaps 0-22.', 'RA inop, low thrust lever angle, flaps 0-18.', 'Any thrust lever, RA inop, flaps 22.', 'c');
INSERT INTO `usedQuestions` VALUES(151, 177, 'mc', 'ldg_gear_brk', 'If engine 1 is shutdown, how is the landing gear extended?', 'Using the electrical override switch.', 'Pulling the freefall lever.', 'With the landing gear handle as normal.', 'All of the above.', 'c');
