INSERT INTO `usedQuestions` VALUES(151, 200, 'mc', 'lighting', 'The emergency light batteries are charged with normal power established on the aircraft and when the emergency light switch is in the:', 'ARM position.', 'Are not charged and replaced periodically by maintenance.', 'OFF position.', 'ON position.', 'a');
INSERT INTO `usedQuestions` VALUES(151, 195, 'tf', 'lighting', 'The nose landing and taxi lights are only illuminated if the respective light switches are on and the gear is down and locked.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(151, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', '160 knots.', '200 knots.', '170 knots.', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', 'a');
