INSERT INTO `usedQuestions` VALUES(151, 228, 'mc', 'oxy', 'The OXYGEN LOW PRESS message appears on the EICAS when:', 'The oxygen pressure is at or below 400 psi.', 'Approximately 30 minutes of crew oxygen remains.', 'Oxygen masks have dropped when they should not have.', 'The passenger oxygen is below 550 psi.', 'a');
INSERT INTO `usedQuestions` VALUES(151, 234, 'mc', 'oxy', 'The green flight crew oxygen system safety disk:', 'Turns red when the pressure is low.', 'Prevents contamination of the discharge line.', 'Is located within the oxygen servicing panel.', 'May indicate that an overpressure has occurred if missing.', 'd');
INSERT INTO `usedQuestions` VALUES(151, 246, 'ac', 'pneum', 'During a bleed leak.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'Hot bleed air is escaping from the bleed lines.', 'The engine bleed valve should automatically close.', 'All of the above.', 'd');
