INSERT INTO `usedQuestions` VALUES(152, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(152, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Has no effect on the hydraulic system.', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Closes the associated hydraulic shutoff valve.', 'Shuts off all hydraulic pressure on the associated side.', 'c');
