INSERT INTO `usedQuestions` VALUES(153, 174, 'mc', 'ice_rain_prot', 'Which statement is true regarding the operation of the clear ice detection on an XRJ?', 'In flight only, when clear ice is present on the wing.', 'On the ground only, when clear ice is present on the wing.', 'On the ground or in flight when clear ice is present on the wing.', 'XRJ''s are not equipped with clear ice detectors.', 'b');
