INSERT INTO `usedQuestions` VALUES(156, 14, 'c2', 'ldg_gear_brk', 'With a total loss of hydraulic system #1, the landing gear:', 'Must be extended with the freefall actuator.', 'Operates using hydraulic system #2 pressure, but may be slower due to the priority valve', 'Cannot be retracted once extended.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(156, 182, 'mc', 'ldg_gear_brk', 'The emergency brake provides:', 'Locked wheel protection, but not touchdown protection.', 'Touchdown protection, but not anti-skid protection.', 'No anti-skid protection.', 'Anti-skid protection only.', 'c');
