INSERT INTO `usedQuestions` VALUES(156, 198, 'mc', 'lighting', 'The courtesy lights:', 'Knob must be left in the AUTO position.', 'Could deplete battery 2 unless turned OFF.', 'Automatically shut off when the airplane is depowered.', 'Come on automatically when normal power is lost.', 'b');
INSERT INTO `usedQuestions` VALUES(156, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', '160 knots.', '200 knots.', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', '170 knots.', 'a');
