INSERT INTO `usedQuestions` VALUES(156, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes, provided the flight crew advises ATC.', 'Yes.', 'No.', 'None of the above.', 'b');
