INSERT INTO `usedQuestions` VALUES(156, 228, 'mc', 'oxy', 'The OXYGEN LOW PRESS message appears on the EICAS when:', 'Approximately 30 minutes of crew oxygen remains.', 'The passenger oxygen is below 550 psi.', 'Oxygen masks have dropped when they should not have.', 'The oxygen pressure is at or below 400 psi.', 'd');
INSERT INTO `usedQuestions` VALUES(156, 227, 'mc', 'oxy', 'The passenger oxygen system includes:', 'Two oxygen bottles, which supply the passenger oxygen masks.', 'Oxygen generators.', '50 inflatable harness masks.', 'Demand flow masks.', 'b');
INSERT INTO `usedQuestions` VALUES(156, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves close.', 'The engine bleed valve closes.', 'Both valves can be open at the same time.', 'The APU bleed valve closes.', 'd');
INSERT INTO `usedQuestions` VALUES(156, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'Open inscription, no line.', 'No line, no open inscription.', 'A line, no OPEN inscription.', 'A line and an OPEN inscription.', 'c');
INSERT INTO `usedQuestions` VALUES(156, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'OPEN, open.', 'AUTO, closed.', 'AUTO, open.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(156, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a');
