INSERT INTO `usedQuestions` VALUES(156, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'b');
INSERT INTO `usedQuestions` VALUES(156, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'Shut the engine down immediately and call maintenance.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'c');
INSERT INTO `usedQuestions` VALUES(156, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '901 C.', '868 C.', '800 C.', '506 C.', 'c');
