INSERT INTO `usedQuestions` VALUES(156, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'There is no automatic reaction.', 'The FADEC reduces the thrust to idle automatically.', 'The thrust reverser stows automatically.', 'All of the above.', 'b');
