INSERT INTO `usedQuestions` VALUES(156, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'Will depressurize up to FL370.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(156, 271, 'mc', 'pressurization', 'The maximum allowed negative cabin differential is ___ PSID:', '7.5', '8.1', '-0.3', '7.8', 'c');
INSERT INTO `usedQuestions` VALUES(156, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately after the PACKs are selected during the after takeoff flow.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'All of the above.', 'a');
