INSERT INTO `usedQuestions` VALUES(156, 289, 'mc', 'radar', 'How can the radar be brought out of FSBY on the ground?', 'The knob must be in WX combined with a wheel speed greater than 25 kts.', 'By turning the the knob from SBY to WX.', 'FSBY cannot be overridden on the ground.', 'By placing the knob on WX and pressing the STAB button 4 times in 3 seconds.', 'd');
INSERT INTO `usedQuestions` VALUES(156, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'At 130 KIAS.', 'A and B are correct.', 'd');
