INSERT INTO `usedQuestions` VALUES(156, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine thrust must be at a minimum of 83% N1.', 'All three bleed valves must be closed.', 'The engine bleed valves must be open.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'c');
INSERT INTO `usedQuestions` VALUES(156, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Select "Mask" on the DAP, twist to Emergency.', 'The crew must ensure that no passengers are on board.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'd');
INSERT INTO `usedQuestions` VALUES(156, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'b');
