INSERT INTO `usedQuestions` VALUES(156, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'a');
INSERT INTO `usedQuestions` VALUES(157, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'The air entering the compressor is too hot.', 'The air leaving the pack is too hot.', 'd');
INSERT INTO `usedQuestions` VALUES(157, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd');
