INSERT INTO `usedQuestions` VALUES(157, 120, 'tf', 'flt_control', 'When in manual reversion, the elevators, ailerons and rudder can all be actuated mechanically.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(157, 119, 'mc', 'flt_control', 'The electromechanical gust lock inserts locking pins into:', 'Ailerons.', 'Inboard spoilers while in flight.', 'Elevator', 'All of the above.', 'c');
