INSERT INTO `usedQuestions` VALUES(157, 141, 'tf', 'fuel', 'The fuel crossfeed valve automatically closes in essential power.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(157, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the pump in the low tank off.', 'c');
