INSERT INTO `usedQuestions` VALUES(157, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '1200 psi.', '2900 psi.', '1600 psi.', '3000 psi.', 'd');
