INSERT INTO `usedQuestions` VALUES(157, 171, 'mc', 'ice_rain_prot', 'Ice test A requires:', 'The override to ENG/test switch held for 20 seconds in each position.', 'Override to AUTO for a minimum of 10 seconds, maximum 30 seconds.', 'Override to AUTO.', 'Override to ALL, test switch for 10 seconds minimum.', 'd');
INSERT INTO `usedQuestions` VALUES(157, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'Not available.', 'Available if selected on or in icing conditions.', 'On and cannot be turned off.', 'Comes from the 9th stage of the compressor only.', 'c');
INSERT INTO `usedQuestions` VALUES(157, 172, 'c2', 'ice_rain_prot', 'Regarding ice protection, what aircraft components are heated electrically?', 'Ice detectors.', 'TAT probes.', 'The leading edge of the wings and the horizontal stabilizer.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(157, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Is not available.', 'Is available with the override switch in ALL.', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(157, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The engine bleeds should be selected open.', 'The use of packs is only permitted if the APU bleed is available.', 'Pack 1 is off, Pack 2 is on.', 'The engines bleeds will always be closed.', 'a');
INSERT INTO `usedQuestions` VALUES(157, 14, 'c2', 'ldg_gear_brk', 'With a total loss of hydraulic system #1, the landing gear:', 'Operates using hydraulic system #2 pressure, but may be slower due to the priority valve', 'Must be extended with the freefall actuator.', 'Cannot be retracted once extended.', 'B and C are correct.', 'd');
