INSERT INTO `usedQuestions` VALUES(157, 207, 'mc', 'limitations', 'While descending through 10,000 ft, you notice the LP spool vibration on engine 1 is in the amber.  How long may it remain in the Amber?', '90 seconds', '5 minutes.', '1 minute.', '10 seconds.', 'd');
INSERT INTO `usedQuestions` VALUES(157, 121, 'mc', 'limitations', 'The maximum airspeed with flaps 18 is:', '140 KIAS.', '200 KIAS.', '250 KIAS.', '160 KIAS.', 'b');
