INSERT INTO `usedQuestions` VALUES(157, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'No.', 'Only if the crossfeed is on.', 'Yes.', 'Yes, provided the flight crew advises ATC.', 'c');
