INSERT INTO `usedQuestions` VALUES(157, 238, 'mc', 'oxy', 'During a rapid cabin depressurization, flight deck crew members receive oxygen from...', 'A portable oxygen bottle.', 'A fixed oxygen cylinder.', 'An oxygen generator.', 'The PBE.', 'b');
INSERT INTO `usedQuestions` VALUES(157, 227, 'mc', 'oxy', 'The passenger oxygen system includes:', 'Oxygen generators.', 'Demand flow masks.', 'Two oxygen bottles, which supply the passenger oxygen masks.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(157, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Ice test A.', 'Low power settings.', 'External air starts.', 'Cross-bleed starts.', 'c');
