INSERT INTO `usedQuestions` VALUES(157, 247, 'mc', 'pneum', 'When will the crossbleed valve open automatically when in the "AUTO" position?', 'During a cross-bleed start.', 'When the override knob on the ice protection panel is in ENG.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(157, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, open.', 'OPEN, open.', 'AUTO, closed.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(157, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'All bleeds open, PACKs on, cross bleed open.', 'b');
INSERT INTO `usedQuestions` VALUES(157, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th compressor stage in icing conditions.', 'The 14th stage compressor only.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(157, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine shuts down and may be restarted after alternating FADECs.', 'The engine shuts down.', 'The other FADEC (same engine) immediately takes over.', 'The engine runs in idle until the pilot resets the FADEC.', 'c');
