INSERT INTO `usedQuestions` VALUES(157, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The FADEC itself.', 'The PMA, only above 10% N2.', 'The PMA, only above 50% N2.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(157, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine shuts down.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine keeps running but thrust cannot be changed.', 'The engine keeps running in N1 reversionary mode.', 'a');
INSERT INTO `usedQuestions` VALUES(157, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'N2 via a linkage on the HP spool.', 'N1 via the tower shaft.', 'Reduction gears via the N1 turbine.', 'N2 via the tower shaft.', 'd');
INSERT INTO `usedQuestions` VALUES(157, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Limits N1 to 106%.', 'Presents the FADEC NO DISP EICAS.', 'Automatically shuts down the engine.', 'Fails and the other FADEC takes over.', 'c');
INSERT INTO `usedQuestions` VALUES(157, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', 'Fuel pressure.', '9th stage bleed air.', 'PMA.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(157, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engine reverts to N1SYN mode.', 'The engines shuts down.', 'FADEC "A" automatically takes over.', 'Engine page 1 automatically appears on RMU1.', 'c');
INSERT INTO `usedQuestions` VALUES(157, 254, 'tf', 'powerplant', 'Do not abort the takeoff if oil pressure increases from the green to the amber range:', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(157, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Will depressurize up to FL370.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(157, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '24,600''.', '25,000''.', '14,000'' +/- 500''.', '1700'' AGL.', 'b');
INSERT INTO `usedQuestions` VALUES(157, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Pitot/static tube 3.', 'The static/pressurization ports.', 'Static ports 1 and 4.', 'Static ports 2 and 3.', 'a');
INSERT INTO `usedQuestions` VALUES(157, 290, 'mc', 'profiles', 'When is CLB thrust selected on a normal takeoff?', 'After radar contact has been established.', 'Once acceleration height and Vfs have been reached.', 'Anytime after the crew feels that they have cleared all obstacles in the departure path.', 'When the PM presses the FLC button on the Flight Guidance Control Panel.', 'b');
INSERT INTO `usedQuestions` VALUES(157, 277, 'mc', 'radar', 'The RADAR gain knob:', 'Should always be pulled out (VAR).', 'Should always be turned to MAX.', 'Changes the intensity of each color displayed.', 'Changes the amount of energy transmitted.', 'c');
INSERT INTO `usedQuestions` VALUES(157, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'White', 'Amber.', 'Red.', 'Green.', 'c');
