INSERT INTO `usedQuestions` VALUES(157, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'All three bleed valves must be closed.', 'The engine thrust must be at a minimum of 83% N1.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine bleed valves must be open.', 'd');
INSERT INTO `usedQuestions` VALUES(157, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'c');
INSERT INTO `usedQuestions` VALUES(157, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'b');
INSERT INTO `usedQuestions` VALUES(157, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'Select "Mask" on the DAP, twist to Emergency.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'b');
INSERT INTO `usedQuestions` VALUES(157, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'APU Fire Loop Fail', 'E1(2) EXTBL A(B) INOP', 'BAGG SMOKE', 'LAV SMOKE', 'c');
INSERT INTO `usedQuestions` VALUES(158, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air leaving the pack is too hot.', 'The air entering the compressor is too hot.', 'The air entering the pack is too hot.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Both packs are on.', 'Both packs are off.', 'Pack 2 is on, 1 is off.', 'Pack 1 is on, 2 is off.', 'c');
