INSERT INTO `usedQuestions` VALUES(158, 32, 'mc', 'apu', 'In case of an APU fire, the APU shuts down:', 'After 10 seconds on the ground, immediately in flight.', 'Immediately in flight.', 'After 10 seconds on the ground.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 17, 'c2', 'apu', 'What power sources can be used to start the APU?', 'Battery 2.', 'Battery 1.', 'The GPU (with batteries in AUTO)', 'A and C are correct.', 'd');
