INSERT INTO `usedQuestions` VALUES(158, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'The FADEC syncs N2 to N1.', 'Engine #1 indications are replaced with amber dashes', 'Aft aircraft systems information is unavailable.', 'None of the above.', 'b');
