INSERT INTO `usedQuestions` VALUES(158, 80, 'mc', 'crew_awareness', 'In essential power, RMU 1:', 'Can be presented by using MFD reversion.', 'Can be presented by using SG reversion.', 'Is powered normally.', 'None of the above.', 'c');
