INSERT INTO `usedQuestions` VALUES(158, 78, 'mc', 'crew_awareness', 'An amber comparator flag for the heading indication means:', 'Check your heading, you''re drifting from the assigned heading.', 'A difference of 6 degrees between the left and right AHRS headings.', 'The FMS is suggesting heading select navigation.', 'The heading system has failed.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(158, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'The hot battery busses, essential busses, and the central DC bus.', 'The entire electrical system.', 'DC bus 1 and DC bus 2', 'All electrical busses except the shed busses.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(158, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The GCUs, EDL and FADECs.', 'c');
