INSERT INTO `usedQuestions` VALUES(158, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Removes power from the backup flight instruments.', 'Opens the BBC, isolating the backup battery hot bus.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Allows a test of the ISIS on LR aircraft.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(158, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'The FMS remains powered.', 'VOR (no DME) can be flown using the RMU navigation page', 'VOR-DME approaches can be flown using the standby instruments.', 'VOR approaches are impossible since the PFD is blank.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', 'c');
INSERT INTO `usedQuestions` VALUES(158, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'a');
INSERT INTO `usedQuestions` VALUES(158, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'APU fire detection and protection is available in essential power.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'The fuel shutoff valve.', 'The engine bleed and lip anti-ice ice valves.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'B and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Closes the associated hydraulic shutoff valve.', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Shuts off all hydraulic pressure on the associated side.', 'Has no effect on the hydraulic system.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(158, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'The speedbrake lever has to be selected to OPEN.', 'A low TLA (thrust lever angle).', 'The flap lever has to be at 0 or 9 degrees.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The rudder is in manual reversion.', 'The deflection is 5 degrees +/- 1 degree.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '22 Degrees.', '18 Degrees.', '45 Degrees.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 127, 'mc', 'flt_control', 'Ailerons are positioned utilizing:', 'Onside hydraulic pressure only.', 'Offside hydraulic pressure only.', 'Both hydraulic systems.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 138, 'mc', 'fuel', 'If the fuel boost pump fails:', 'The engine will continue to run by suction feed through a check valve.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will eventually flame out due to lack of fuel.', 'The engine will continue to run, but at reduced thrust.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 140, 'mc', 'fuel', 'In essential power:', 'No fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the pump in the low tank off.', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 2.', 'Closing the fuel shutoff value in tank 1.', 'De-energizing the boost pumps in tank 1.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 137, 'tf', 'fuel', 'Crossfeeding will not inhibit transfer of fuel from the ventral tank to the wing tanks.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(158, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The flaps will not extend.', 'The flaps operate normally.', 'The landing gear retracts normally.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 155, 'mc', 'hydraulics', 'In essential power, the electric hydraulic pumps are:', 'Only the #1 pump is available for landing gear extension.', 'Both available.', 'Not available.', 'Only the #2 pump is available for the emergency brakes.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Places the electric hydraulic pump in a standby condition.', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'Turns on the electric pump regardless of system pressure.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 149, 'mc', 'hydraulics', 'The priority valve in hydraulic system 1 provides:', 'Gives hydraulic system 1 priority over hydraulic system 2.', 'Ensures hydraulic pressure to the landing gear when operating on the electric hydraulic pump.', 'Restricts hydraulic presure from the landing gear to the ensure pressure for the flight controls.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Extend normally using the gear handle.', 'Are held up by a mechanical uplock.', 'Freefall', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 160, 'mc', 'ice_rain_prot', 'When is engine lip anti-ice required?', 'Whenever the TAT heating is selected ON.', 'Whenever the temperature is 10 C or less and visible moisture is present.', 'Whenever visible moisture is present.', 'Whenever the temperature is 10 C or less.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The use of packs is only permitted if the APU bleed is available.', 'The engine bleeds should be selected open.', 'The engines bleeds will always be closed.', 'Pack 1 is off, Pack 2 is on.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Fails closed (OFF) in essential power.', 'Cannot be activated unless ice is detected.', 'Uses bleed air from the 9th stage of the compressor.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'The essential buses.', 'DC Bus 1.', 'The shed bus.', 'DC Bus 2.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The XR has boots.', 'The vertical stabilizer is heated.', 'No ice test is needed.', 'There are clear ice-detectors on the wings.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 180, 'tf', 'ldg_gear_brk', 'When using the emergency brakes, the anti-skid, locked wheel and touchdown protection are not available.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(158, 192, 'mc', 'ldg_gear_brk', 'What parameters allow us to cancel a landing gear aural warning message?', '<1200'' AGL, low thrust lever angle, flaps 0-22.', 'Any thrust lever, RA inop, flaps 22.', 'RA inop, low thrust lever angle, flaps 0-18.', 'Any thrust lever angle, flaps 45.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 179, 'mc', 'ldg_gear_brk', 'The landing gear is normally help up ___ and extended ___.', 'Mechanically, Mechanically.', 'Hydrualically, hydrualically.', 'Mechanically, hydrualically.', 'Hydraulically, Mechanically.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 200, 'mc', 'lighting', 'The emergency light batteries are charged with normal power established on the aircraft and when the emergency light switch is in the:', 'ARM position.', 'ON position.', 'Are not charged and replaced periodically by maintenance.', 'OFF position.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 202, 'mc', 'lighting', 'What is the power source for the nose landing light?', 'DC.', 'Backup bus.', 'Essential.', 'Shed.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 208, 'mc', 'limitations', 'What is the minimum oil temperature required to increase N2 above 83%?', '20 degrees F.', '40 degrees C.', '20 degrees C.', '40 degrees F.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '200 knots.', '250 knots.', '240 knots.', '180 knots.', 'a');
