INSERT INTO `usedQuestions` VALUES(158, 287, 'mc', 'limitations', 'Can an engine start be allowed to continue if the oil pressure is in the amber range?', 'No - this is an abnormal condition and the start should be aborted regardless of temperature.', 'Yes - if the ITT is more than 600 C.', 'Yes - if the oil temperature is less than 21 C.', 'Yes - oil pressure limitations only apply during the takeoff phase.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 215, 'mc', 'limitations', 'What is VLE?', '180 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', '200 knots.', '250 knots.', 'd');
