INSERT INTO `usedQuestions` VALUES(158, 221, 'mc', 'limitations', 'The engines have been running for 8 minutes and the oil temperature is 40 C.  What action is appropriate?', 'Complete a static run-up to 88% N2 and allow the engines to stabilize.', 'Delay takeoff until the oil temperature is above 40 C.', 'Takeoff.', 'Notify maintenance and return to the gate.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-52 C.', '-30 C.', '-45 C with momentary deviations to -50 C permitted.', '-65 C.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 226, 'mc', 'oxy', 'With the passenger oxygen knob in AUTO (non-XR) the passenger oxygen masks drop at:', '9,900 +/- 100'' cabin altitude.', '14,000'' AGL.', '14,000'' MSL.', '14,000'' cabin altitude.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 227, 'mc', 'oxy', 'The passenger oxygen system includes:', 'Oxygen generators.', '50 inflatable harness masks.', 'Demand flow masks.', 'Two oxygen bottles, which supply the passenger oxygen masks.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'External air starts.', 'Low power settings.', 'Ice test A.', 'Cross-bleed starts.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, open.', 'AUTO, closed.', 'OPEN, open.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'No line, no open inscription.', 'A line, no OPEN inscription.', 'A line and an OPEN inscription.', 'Open inscription, no line.', 'b');
INSERT INTO `usedQuestions` VALUES(158, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'All bleeds open, PACKs on, cross bleed open.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(158, 247, 'mc', 'pneum', 'When will the crossbleed valve open automatically when in the "AUTO" position?', 'During a cross-bleed start.', 'During ice test A.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 265, 'mc', 'powerplant', 'Which is not an item in the engine''s accessory gear box?', 'Hydraulic pump.', 'Engine driven generator.', 'Ejector pump.', 'Oil pump.', 'c');
