INSERT INTO `usedQuestions` VALUES(158, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The PMA, only above 50% N2.', 'The essential buses.', 'The FADEC itself.', 'The PMA, only above 10% N2.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 254, 'tf', 'powerplant', 'During the takeoff, oil pressure rises to 117 PSI.  The takeoff should not be aborted.', 'TRUE', 'FALSE', '', '', 'a');
