INSERT INTO `usedQuestions` VALUES(158, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD takeoff page.', 'EICAS.', 'RMU maintenance page.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Presents the FADEC NO DISP EICAS.', 'Fails and the other FADEC takes over.', 'Automatically shuts down the engine.', 'Limits N1 to 106%.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 24, 'ac', 'powerplant', 'The engine has:', 'A 14 stage compressor.', 'A 2 stage high-pressure turbine.', '6 stages of CVG vanes.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine shuts down.', 'The engine keeps running but thrust cannot be changed.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'The engine keeps running in N1 reversionary mode.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '25,000''.', '24,600''.', '1700'' AGL.', '14,000'' +/- 500''.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the ADCs.', 'Provide static information to the CPAM.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'Immediately after the PACKs are selected during the after takeoff flow.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 291, 'mc', 'profiles', 'When must the airplane be in a planned and approved configuration on approach?', 'At the completion of the landing checklist.', '1500 AGL in IMC and 500'' AGL in VMC.', '1500'' AGL.', '1000'' above TDZE.', 'd');
INSERT INTO `usedQuestions` VALUES(158, 277, 'mc', 'radar', 'The RADAR gain knob:', 'Should always be pulled out (VAR).', 'Changes the intensity of each color displayed.', 'Should always be turned to MAX.', 'Changes the amount of energy transmitted.', 'b');
