INSERT INTO `usedQuestions` VALUES(158, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'Red.', 'Amber.', 'Green.', 'White', 'a');
INSERT INTO `usedQuestions` VALUES(158, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'c');
INSERT INTO `usedQuestions` VALUES(158, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine bleed valves must be open.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'All three bleed valves must be closed.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(158, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'c');
INSERT INTO `usedQuestions` VALUES(158, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'APU Fire Loop Fail', 'LAV SMOKE', 'BAGG SMOKE', 'E1(2) EXTBL A(B) INOP', 'c');
INSERT INTO `usedQuestions` VALUES(158, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'Select "Mask" on the DAP, twist to Emergency.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'The crew must ensure that no passengers are on board.', 'a');
INSERT INTO `usedQuestions` VALUES(159, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'B and C are correct.', 'd');
