INSERT INTO `usedQuestions` VALUES(159, 7, 'mc', 'crew_awareness', 'If the CA side AHRS fails:', 'Airspeed will be covered with hash marks', 'The messages ATT FAIL, HDG FAIL, and HDG FAIL will be displayed on the PFD and MFD', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(159, 66, 'mc', 'crew_awareness', 'An amber IAS comparator flag is presented when:', 'Approaching maximum airspeed (redline).', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'SPEED HOLD flight director mode is on.', 'b');
