INSERT INTO `usedQuestions` VALUES(159, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'VOR approaches are impossible since the PFD is blank.', 'VOR-DME approaches can be flown using the standby instruments.', 'a');
INSERT INTO `usedQuestions` VALUES(159, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(159, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You have one electrical system despite having 4 or more generators on-line.', 'You are not in the essential power configuration but should be.', 'Is normal during a loss of all generators.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(159, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered.', 'All DC buses are powered if the shed bus knob is in OVRD.', 'All DC buses are powered except the shed buses.', 'All of the above.', 'c');
