INSERT INTO `usedQuestions` VALUES(159, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Five, 28 Volt DC generators.', 'Five, 24 Volt DC generators.', 'Four, 28 Volt DC generators.', 'Four, 24 Volt DC generators.', 'a');
INSERT INTO `usedQuestions` VALUES(159, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(159, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Allows a test of the ISIS on LR aircraft.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Opens the BBC, isolating the backup battery hot bus.', 'Removes power from the backup flight instruments.', 'c');
INSERT INTO `usedQuestions` VALUES(159, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'a');
INSERT INTO `usedQuestions` VALUES(159, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'd');
INSERT INTO `usedQuestions` VALUES(159, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Fire extinguishing handle - PULL & ROTATE.', 'Start/Stop Selector - STOP.', 'Thrust lever - IDLE.', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'c');
