INSERT INTO `usedQuestions` VALUES(159, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'B and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(159, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'The flap lever has to be at 0 or 9 degrees.', 'The speedbrake lever has to be selected to OPEN.', 'A low TLA (thrust lever angle).', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(159, 122, 'mc', 'flt_control', 'The speedbrakes do not open if:', 'The flaps are extended to 22 degrees.', 'The gear is down.', 'Hydraulic system 1 fails.', 'The thrust levers are in idle.', 'a');
INSERT INTO `usedQuestions` VALUES(159, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The rudder is in manual reversion.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The deflection is 5 degrees +/- 1 degree.', 'c');
INSERT INTO `usedQuestions` VALUES(159, 127, 'mc', 'flt_control', 'Ailerons are positioned utilizing:', 'Onside hydraulic pressure only.', 'Both hydraulic systems.', 'Offside hydraulic pressure only.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(159, 120, 'tf', 'flt_control', 'When in manual reversion, the elevators, ailerons and rudder can all be actuated mechanically.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(159, 137, 'tf', 'fuel', 'Crossfeeding will not inhibit transfer of fuel from the ventral tank to the wing tanks.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(159, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 1.', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 1.', 'b');
INSERT INTO `usedQuestions` VALUES(159, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'The FMS shows fuel remaining on arrival of less than 1800 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'd');
