INSERT INTO `usedQuestions` VALUES(159, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(159, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '2900 psi.', '1600 psi.', '1200 psi.', '3000 psi.', 'd');
INSERT INTO `usedQuestions` VALUES(159, 149, 'mc', 'hydraulics', 'The priority valve in hydraulic system 1 provides:', 'Allows hydraulic system 2 to assist hydraulic system 1 in low pressure situations.', 'Restricts hydraulic presure from the landing gear to the ensure pressure for the flight controls.', 'Gives hydraulic system 1 priority over hydraulic system 2.', 'None of the above.', 'b');
