INSERT INTO `usedQuestions` VALUES(159, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Ailerons and rudder should all pressure be lost.', 'Emergency brakes.', 'Nosewheel steering.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(159, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'The shed bus.', 'DC Bus 2.', 'The essential buses.', 'DC Bus 1.', 'c');
INSERT INTO `usedQuestions` VALUES(159, 169, 'mc', 'ice_rain_prot', 'When taxiing in icing conditions:', 'The APU bleed cannot be used becuase it is not hot enough for engine anti-ice.', 'The engines bleeds must be open for anti-ice.', 'The APU bleed can be used but only for a single engine taxi, since it is on the left side of the system.', 'The APU bleed air can be used for air conditioning.', 'd');
INSERT INTO `usedQuestions` VALUES(159, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The XR has boots.', 'There are clear ice-detectors on the wings.', 'No ice test is needed.', 'The vertical stabilizer is heated.', 'b');
