INSERT INTO `usedQuestions` VALUES(159, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The engines bleeds will always be closed.', 'Pack 1 is off, Pack 2 is on.', 'The use of packs is only permitted if the APU bleed is available.', 'The engine bleeds should be selected open.', 'd');
INSERT INTO `usedQuestions` VALUES(159, 187, 'mc', 'ldg_gear_brk', 'On the nose landing gear tires, the chines are mounted:', 'Outboard.', 'Inboard.', 'Nose landing gear tires do not have chines.', 'inboard on XR''s only.', 'a');
