INSERT INTO `usedQuestions` VALUES(159, 190, 'tf', 'ldg_gear_brk', 'The purpose of the landing gear over-center brace is to keep the landing gear down and locked.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(159, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'Dedicated batteries.', 'Photo luminescent; no power source required.', 'DC bus.', 'Essential bus.', 'a');
INSERT INTO `usedQuestions` VALUES(159, 197, 'mc', 'lighting', 'The emergency lights will last a minimum of:', '40 minutes.', '15 minutes.', '45 minutes if pitot 3 heat is turned off.', '30 minutes.', 'b');
