INSERT INTO `usedQuestions` VALUES(160, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Shut the engine down immediately and call maintenance.', 'a');
