INSERT INTO `usedQuestions` VALUES(160, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately after the PACKs are selected during the after takeoff flow.', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'a');
