INSERT INTO `usedQuestions` VALUES(160, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Will depressurize up to FL370.', 'Is not useable in manual pressurization mode.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'B and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(160, 276, 'mc', 'profiles', 'During takeoff, if an engine fire is indicated after V1:', 'Perform the engine fire QRH at acceleration height after reaching Vfs.', 'Continue the takeoff and perform the engine fire QRH after reaching V2.', 'Continue the takeoff and perform the engine fire QRH after reaching a safe altitude.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(160, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'GMAP mode is only available during ground operations.', 'The radar cannot be used on the ground.', 'Increasing gain increases receiver sensitivity.', 'Increasing gain increases the energy output from the antenna.', 'c');
INSERT INTO `usedQuestions` VALUES(160, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'Green.', 'Red.', 'White', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(160, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(160, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'BAGG SMOKE', 'LAV SMOKE', 'E1(2) EXTBL A(B) INOP', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(160, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'a');
INSERT INTO `usedQuestions` VALUES(160, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'd');
INSERT INTO `usedQuestions` VALUES(160, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Select "Mask" on the DAP, twist to Emergency.', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'None of the above.', 'c');
