INSERT INTO `usedQuestions` VALUES(161, 66, 'mc', 'crew_awareness', 'An amber IAS comparator flag is presented when:', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'Approaching maximum airspeed (redline).', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'All of the above.', 'c');
