INSERT INTO `usedQuestions` VALUES(161, 76, 'mc', 'elec', 'The ELT battery:', 'Is charged by the shed buses', 'Is charged only when the ELT switch is in the ARM position.', 'Is not charged.', 'Is charged by the esential busses', 'c');
INSERT INTO `usedQuestions` VALUES(161, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'a');
