INSERT INTO `usedQuestions` VALUES(161, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Closes the associated hydraulic shutoff valve.', 'Shuts off all hydraulic pressure on the associated side.', 'Has no effect on the hydraulic system.', 'b');
