INSERT INTO `usedQuestions` VALUES(161, 128, 'mc', 'flt_control', 'During normal cruise flight, the rudder Power Control Unit receives hydraulic pressure from:', 'Essential DC bus.', 'Both hydraulic systems.', 'Hydraulic system 1.', 'Hydraulic system 2.', 'd');
