INSERT INTO `usedQuestions` VALUES(161, 290, 'mc', 'profiles', 'When is CLB thrust selected on a normal takeoff?', 'When the PM presses the FLC button on the Flight Guidance Control Panel.', 'Once acceleration height and Vfs have been reached.', 'Anytime after the crew feels that they have cleared all obstacles in the departure path.', 'After radar contact has been established.', 'b');
