INSERT INTO `usedQuestions` VALUES(161, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'b');
INSERT INTO `usedQuestions` VALUES(161, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'When the low speed awareness tape is in the amber range.', 'At 130 KIAS.', 'When the aircraft symbol touches the PLI.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(161, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'APU Fire Loop Fail', 'BAGG SMOKE', 'LAV SMOKE', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(161, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine bleed valves must be open.', 'The engine thrust must be at a minimum of 83% N1.', 'All three bleed valves must be closed.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'a');
INSERT INTO `usedQuestions` VALUES(161, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'd');
INSERT INTO `usedQuestions` VALUES(161, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'Select "Mask" on the DAP, twist to Emergency.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(161, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'b');
INSERT INTO `usedQuestions` VALUES(162, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(162, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs turn off.', 'Only pack 1 turns off.', 'Only pack 2 turns off.', 'None of the above.', 'a');
