INSERT INTO `usedQuestions` VALUES(162, 9, 'mc', 'apu', 'Fuel control and starting for the APU (Model T-62T-40C14) is provided from:', 'FADEC', 'EICAS', 'Starter/Generator', 'Manual controls', 'a');
