INSERT INTO `usedQuestions` VALUES(162, 66, 'mc', 'crew_awareness', 'An amber IAS flag on the PFD indicates:', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'Approaching maximum airspeed (redline).', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'SPEED HOLD flight director mode is on.', 'a');
INSERT INTO `usedQuestions` VALUES(162, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'The standby airspeed indicator becomes unreliable.', 'A red failure indication appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'B and C are correct.', 'd');
