INSERT INTO `usedQuestions` VALUES(162, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BC 1 and BC 2 are closed.', 'BC 1 and BC 2 are open.', 'The ALC is closed if the APU has been started.', 'BTC 1 & 2 are open.', 'b');
