INSERT INTO `usedQuestions` VALUES(162, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(162, 92, 'c2', 'elec', 'The shed buses are powered:', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'B and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(162, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'The entire electrical system.', 'The hot battery busses, essential busses, and the central DC bus.', 'All electrical busses except the shed busses.', 'DC bus 1 and DC bus 2', 'b');
INSERT INTO `usedQuestions` VALUES(162, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You have one electrical system despite having 4 or more generators on-line.', 'Is normal during a loss of all generators.', 'You are not in the essential power configuration but should be.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(162, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'a');
