INSERT INTO `usedQuestions` VALUES(162, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', '1 Halon fire bottle for the lavatory waste basket', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(162, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(162, 107, 'tf', 'fire_prot', 'APU fire detection and protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(162, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Closes the associated hydraulic shutoff valve.', 'Has no effect on the hydraulic system.', 'Shuts off all hydraulic pressure on the associated side.', 'b');
INSERT INTO `usedQuestions` VALUES(162, 123, 'mc', 'flt_control', 'Elevator trim is accomplished by:', 'Positioning the fixed trim tab; the spring tab is a servo tab only.', 'Positioning the spring and fixed tabs on the trailing edges of the elevator.', 'Positioning the horizontal stabilizer.', 'Positioning the elevator with the main or backup trim switches.', 'c');
INSERT INTO `usedQuestions` VALUES(162, 120, 'tf', 'flt_control', 'When in manual reversion, the elevators, ailerons and rudder can all be actuated mechanically.', 'TRUE', 'FALSE', '', '', 'a');
