INSERT INTO `usedQuestions` VALUES(162, 140, 'mc', 'fuel', 'In essential power:', 'All fuel boost pumps are available.', 'No fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'c');
INSERT INTO `usedQuestions` VALUES(162, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Turns on the electric pump regardless of system pressure.', 'Places the electric hydraulic pump in a standby condition.', 'Turns on the electric pump only if the engine is shut down.', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'a');
INSERT INTO `usedQuestions` VALUES(162, 148, 'c2', 'hydraulics', 'What does the AUTO position of the electric hydraulic pump knob provide?', 'The pump does not operate unless the ON position is selected.', 'The pump is kept in standby until the engine driven pump pressure drops below a set value.', 'The pump is kept in standby until the asociated engine N2 drops below a set value.', 'B and C are correct.', 'd');
