INSERT INTO `usedQuestions` VALUES(162, 230, 'tf', 'oxy', 'When the passenger masks fall, the oxygen flow starts without the passengers taking any action.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(162, 224, 'mc', 'oxy', 'In order to test the ACM''s oxygen mask, select mask on the ACM and either pilot''s DAP and:', 'Use the test/reset switch on the ACM''s oxygen mask.', 'Press the emergency button on the ACM''s digital audio panel.', 'Turn the regulator knob to the emergency position and listen for the flow of oxygen.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(162, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'The air leaving the pack is too hot.', 'Air after the compressor is too hot.', 'Air leaving the pre-cooler is too hot.', 'All of the above.', 'c');
