INSERT INTO `usedQuestions` VALUES(162, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The PMA, only above 50% N2.', 'The PMA, only above 10% N2.', 'The FADEC itself.', 'The essential buses.', 'b');
