INSERT INTO `usedQuestions` VALUES(162, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '1700'' AGL.', '25,000''.', '14,000'' +/- 500''.', '24,600''.', 'b');
INSERT INTO `usedQuestions` VALUES(162, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'Immediately after the PACKs are selected during the after takeoff flow.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'b');
INSERT INTO `usedQuestions` VALUES(162, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Provide static information to the CPAM.', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the ADCs.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'b');
INSERT INTO `usedQuestions` VALUES(162, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Above a safe altitude.', 'Positive rate of climb.', 'Vfs.', 'Reaching acceleration height and then a speed of V2 + 15.', 'd');
INSERT INTO `usedQuestions` VALUES(162, 277, 'mc', 'radar', 'The RADAR gain knob:', 'Should always be pulled out (VAR).', 'Changes the intensity of each color displayed.', 'Should always be turned to MAX.', 'Changes the amount of energy transmitted.', 'b');
INSERT INTO `usedQuestions` VALUES(162, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'If one channel of the SPS is inoperative.', 'If the airspeed is less than 200 kts.', 'During an SPS test.', 'If the SPS/ICE SPEEDs message is displayed.', 'a');
INSERT INTO `usedQuestions` VALUES(162, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'b');
INSERT INTO `usedQuestions` VALUES(162, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'LAV SMOKE', 'BAGG SMOKE', 'E1(2) EXTBL A(B) INOP', 'APU Fire Loop Fail', 'b');
INSERT INTO `usedQuestions` VALUES(162, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'a');
INSERT INTO `usedQuestions` VALUES(162, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'All three bleed valves must be closed.', 'The engine bleed valves must be open.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine thrust must be at a minimum of 83% N1.', 'b');
INSERT INTO `usedQuestions` VALUES(162, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'Select "Mask" on the DAP, twist to Emergency.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'The crew must ensure that no passengers are on board.', 'a');
INSERT INTO `usedQuestions` VALUES(162, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 28, 'mc', 'air_condition', 'While executing a go-around in T/O thrust at 1100  AGL...', 'Only pack 1 turns off.', 'Both packs stay on.', 'Only pack 2 turns off.', 'Both packs turn off.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Baggage compartment door.', 'Under cockpit access hatch.', 'Forward nose hydraulic compartment.', 'Overwing emergency exit.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 17, 'c2', 'apu', 'The APU can be started using:', 'Battery 2.', 'Battery 1.', 'The GPU (with batteries in AUTO)', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '54 C', '-20 C', '40 C', '70 C', 'b');
INSERT INTO `usedQuestions` VALUES(163, 53, 'mc', 'autopilot', 'Crews must always verify that the autopilot is coupled to the PF by looking at the:', 'Flight Director button on the Flight Guidance Control Panel', 'Flight Guidance Controller', 'Flight Mode Anunciator (FMA).', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 43, 'c2', 'autopilot', 'Arming the TO vertical flight guidance mode will position the command bars to:', '14 degrees pitch up attitude (Flaps 9).', '14 degrees pitch up attitude (Flaps 18).', '13 degrees pitch up attitude (Flaps 18).', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 55, 'mc', 'autopilot', 'What button on the Display Control Panel would you push to allow navigation using the FMS?', 'FMS', 'TTG', 'NAV', 'LNAV', 'a');
INSERT INTO `usedQuestions` VALUES(163, 39, 'mc', 'autopilot', 'What change should be observed on the FMA after clicking the TOGA buttons on the ground?', 'GA mode is activated on the flight director.', 'The thrust rating changes to full thrust.', 'TO mode is activated on the flight director.', 'The flight director shows a 10 degree pitch up indication for takeoff.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 46, 'mc', 'autopilot', 'If FMS is the selected NAV source on the display control panel, which button on the flight control panel would push to arm LNAV?', 'NAV', 'HDG, then FMS.', 'FMS', 'HDG', 'a');
INSERT INTO `usedQuestions` VALUES(163, 86, 'mc', 'crew_awareness', 'Which anomaly would be indicated on the PFDs by an amber "CAS MSG"?', 'A disagreement between IC-600''s on EICAS messages displayed.', 'Altitude displayed on each PFD differs by more than 200 feet.', 'IAS displayed on each PFD differs by more than 5 knots.', 'SG reversion has been selected.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 60, 'mc', 'crew_awareness', 'The emergency button on the digital audio panel:', 'Commands the TBCH to operate in the emergency mode.', 'Automatically switches to VHF 1 to 121.50.', 'Illuminates the EMER button on the flight attendant interphone.', 'Connect the captain only to COM 1 and NAV 1 and FO to COM 2 and NAV 2.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 83, 'tf', 'crew_awareness', 'Pressing the DAU 2 button on the EICAS reversionary panel changes the active channel from DAU 2A to DAU 2B.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(163, 6, 'mc', 'crew_awareness', 'Which indication could represent a failure of DAU 1A?', 'Aft aircraft systems information is unavailable.', 'Engine #1 indications are replaced with amber dashes', 'DAU 1B automatically takes over.', 'The FADEC syncs N2 to N1.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot/Static tube 3', 'Pitot 1/Static ports 1 & 4.', 'Pitot 2/Static ports 2 & 3.', 'Pitot 1/Fadec pressurization static port.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'As soon as the electrical system is powered.', 'By turning on the red beacon.', 'By turning on the navigation lights.', 'By a 5G impact or immersion in water.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Fuel and baggage doors.', 'Main and service doors.', 'Main cabin door only.', 'Over-wing emergency exit.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 66, 'mc', 'crew_awareness', 'An amber IAS comparator flag is presented when:', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'SPEED HOLD flight director mode is on.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 85, 'mc', 'crew_awareness', 'How do the 5 cockpit CRTs appear following the loss of DC Bus 2?', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'PFD 2 and MFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'It doesn''t appear anywhere immediately.', 'RMU 1.', 'MFD 1.', 'TBCH.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'The FMS remains powered.', 'VOR (no DME) can be flown using the RMU navigation page', 'VOR-DME approaches can be flown using the standby instruments.', 'VOR approaches are impossible since the PFD is blank.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The GCUs, EDL and FADECs.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The AHRS to prevent loss of alignment data.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(163, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(163, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The ground air supply is supplying bleed air to the packs.', 'That the GPU is plugged in with some power available.', 'The ground power unit is disconnected from the aircraft.', 'The aircraft electrical system is powered.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Four, 28 Volt DC generators.', 'Four, 24 Volt DC generators.', 'Five, 28 Volt DC generators.', 'Five, 24 Volt DC generators.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'Weather Radar.', 'TCAS.', 'EGPWS/Wind Shear.', 'B and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'DC bus 1 and DC bus 2', 'All electrical busses except the shed busses.', 'The hot battery busses, essential busses, and the central DC bus.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 90, 'tf', 'elec', 'The ground service bus is only powered with an available GPU NOT selected and the batteries OFF.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(163, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'a');
INSERT INTO `usedQuestions` VALUES(163, 104, 'mc', 'fire_prot', 'When a fire extinguishing handle is pulled:', 'The fuel shutoff valve closes.', 'The respective engine fire bottle is discharged.', 'The engine will not shut down unless the thrust lever is in idle.', 'The hydraulic shutoff valve is opened.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Closes the associated hydraulic shutoff valve.', 'Shuts off all hydraulic pressure on the associated side.', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Has no effect on the hydraulic system.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '1', '3', '2', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'High pressure in the fire loop will trigger a FIRE warning message.', 'APU fire detection and protection is available in essential power.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '22 Degrees.', '45 Degrees.', '18 Degrees.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 122, 'mc', 'flt_control', 'The speedbrakes do not open if:', 'The gear is down.', 'The flaps are extended to 22 degrees.', 'The thrust levers are in idle.', 'Hydraulic system 1 fails.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The rudder is in manual reversion.', 'The deflection is 5 degrees +/- 1 degree.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a failure of the flap velocity sensor.', 'Indicates a failure of the teleflex cable.', 'Indicates a flap motor failure.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(163, 133, 'mc', 'fuel', 'The fuel temperature on the MFD is measured at:', 'The left fuel tank.', 'The ACOC.', 'The FCOC.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 137, 'tf', 'fuel', 'Crossfeeding will not inhibit transfer of fuel from the ventral tank to the wing tanks.', 'TRUE', 'FALSE', '', '', 'b');
INSERT INTO `usedQuestions` VALUES(163, 140, 'mc', 'fuel', 'In essential power:', 'Only the C fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'All fuel boost pumps are available.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'Fuel is used from the ventral tank first, then from the wings.', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 138, 'mc', 'fuel', 'If the fuel boost pump fails:', 'The engine will eventually flame out due to lack of fuel.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will continue to run by suction feed through a check valve.', 'The engine will continue to run, but at reduced thrust.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Emergency brakes.', 'Ailerons and rudder should all pressure be lost.', 'Nosewheel steering.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 148, 'c2', 'hydraulics', 'What does the AUTO position of the electric hydraulic pump knob provide?', 'The pump is kept in standby until the engine driven pump pressure drops below a set value.', 'The pump is kept in standby until the asociated engine N2 drops below a set value.', 'The pump does not operate unless the ON position is selected.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 155, 'mc', 'hydraulics', 'In essential power, the electric hydraulic pumps are:', 'Only the #1 pump is available for landing gear extension.', 'Only the #2 pump is available for the emergency brakes.', 'Not available.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'Turns on the electric pump only if the engine is shut down.', 'Turns on the electric pump regardless of system pressure.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '1600 psi.', '0 psi.', '2900 psi.', '3000 psi.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The use of packs is only permitted if the APU bleed is available.', 'The engines bleeds will always be closed.', 'The engine bleeds should be selected open.', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'They are never inhbited.', 'With the FADEC Ref. anti-ice selected OFF.', 'During a bleed overtemp.', 'On the ground with a wheel speed at or below 25 kts.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'Is available with the override switch in ALL.', 'Is on and cannot be turned off.', 'Is not available.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Fails closed (OFF) in essential power.', 'Uses bleed air from the 9th stage of the compressor.', 'Cannot be activated unless ice is detected.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 160, 'mc', 'ice_rain_prot', 'When is engine lip anti-ice required?', 'Whenever the TAT heating is selected ON.', 'Whenever the temperature is 10 C or less.', 'Whenever the temperature is 10 C or less and visible moisture is present.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 187, 'mc', 'ldg_gear_brk', 'On the nose landing gear tires, the chines are mounted:', 'Nose landing gear tires do not have chines.', 'Outboard.', 'Inboard.', 'inboard on XR''s only.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 14, 'c2', 'ldg_gear_brk', 'With a total loss of hydraulic system #1, the landing gear:', 'Operates using hydraulic system #2 pressure, but may be slower due to the priority valve', 'Must be extended with the freefall actuator.', 'Cannot be retracted once extended.', 'B and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 176, 'mc', 'ldg_gear_brk', 'The emergency brake lines supply:', 'All 4 brakes.', 'The outboard brakes only.', 'All 6 brakes.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 198, 'mc', 'lighting', 'The courtesy lights:', 'Could deplete battery 2 unless turned OFF.', 'Knob must be left in the AUTO position.', 'Automatically shut off when the airplane is depowered.', 'Come on automatically when normal power is lost.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 199, 'mc', 'lighting', 'Aisle path lighting in the XR consists of:', 'There is no aisle path lighting.', 'Photo luminescent lighting.', 'Red and white lights powered by the backup battery.', 'A steady set of green lights powered by DC bus 1.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', '900 lbs.', '800 lbs.', '100 lbs.', 'No maximum exists provided the roll trim is operative.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'No.', 'Yes, provided the flight crew advises ATC.', 'Yes.', 'Only if the crossfeed is on.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-40 F.', '-40 C.', '-20 C.', '-20 F.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 134, 'mc', 'limitations', 'The maximum allowed fuel imbalance in the LR is ___ lbs.', '800.', '1000.', '100.', '365.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '180 knots.', '200 knots.', '250 knots.', '240 knots.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', '200 knots.', '160 knots.', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', '170 knots.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 45 C.', 'ISA + 35 C.', 'ISA + 25 C.', 'ISA + 15 C.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 221, 'mc', 'limitations', 'The engines have been running for 8 minutes and the oil temperature is 40 C.  What action is appropriate?', 'Takeoff.', 'Notify maintenance and return to the gate.', 'Complete a static run-up to 88% N2 and allow the engines to stabilize.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-30 C.', '-45 C with momentary deviations to -50 C permitted.', '-52 C.', '-65 C.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '20.', '-20.', '-65.', '-40.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 236, 'nc', 'oxy', 'The ACM oxygen mask storage unit:', 'Has only a visible test flow blinker.', 'Is identical to the CA & FO.', 'Has only a test button.', 'None of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 234, 'mc', 'oxy', 'The green flight crew oxygen system safety disk:', 'Prevents contamination of the discharge line.', 'Turns red when the pressure is low.', 'May indicate that an overpressure has occurred if missing.', 'Is located within the oxygen servicing panel.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'The air leaving the pack is too hot.', 'A massive leak detector has detected a bleed leak.', 'Air after the compressor is too hot.', 'Air leaving the pre-cooler is too hot.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'The engine bleed valve should automatically close.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line and an OPEN inscription.', 'A line, no OPEN inscription.', 'Open inscription, no line.', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs off.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 247, 'mc', 'pneum', 'When will the crossbleed valve open automatically when in the "AUTO" position?', 'During ice test A.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'During a cross-bleed start.', 'When the override knob on the ice protection panel is in ENG.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The essential buses.', 'The FADEC itself.', 'The PMA, only above 10% N2.', 'The PMA, only above 50% N2.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'N2 via the tower shaft.', 'N1 via the tower shaft.', 'N2 via a linkage on the HP spool.', 'Reduction gears via the N1 turbine.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', 'Approximately 28.5 percent N2.', '12-14 percent N2.', 'Immediately after IGN is displayed on the EICAS.', '56.4 percent N2.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 265, 'mc', 'powerplant', 'Which is not an item in the engine''s accessory gear box?', 'Oil pump.', 'Ejector pump.', 'Engine driven generator.', 'Hydraulic pump.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 266, 'mc', 'powerplant', 'Which is not a pilot selectable thrust setting for the A1E engine?', 'TO-RSV.', 'TO-1.', 'ALT-TO.', 'E-TO.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine shuts down.', 'The engine runs in idle until the pilot resets the FADEC.', 'The engine shuts down and may be restarted after alternating FADECs.', 'The other FADEC (same engine) immediately takes over.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '2 minutes.', '1 minute.', '3 minutes.', '5 minutes.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD takeoff page.', 'RMU maintenance page.', 'MFD Hydraulic page.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 24, 'ac', 'powerplant', 'The engine has:', 'A 14 stage compressor.', '6 stages of CVG vanes.', 'A 2 stage high-pressure turbine.', 'All of the above.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Provide static information to the ADCs.', 'Provide static information to the CPAM.', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 268, 'mc', 'pressurization', 'Which altitude needs to be set by the pilot in the automatic pressurization system?', 'Takeoff elevation.', 'Cruise altitude.', 'Desired cabin altitude.', 'Landing elevation.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'Will depressurize up to FL370.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Vfs.', 'Reaching acceleration height and then a speed of V2 + 15.', 'Positive rate of climb.', 'Above a safe altitude.', 'b');
