INSERT INTO `usedQuestions` VALUES(163, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'Amber.', 'White', 'Red.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(163, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine thrust must be at a minimum of 83% N1.', 'All three bleed valves must be closed.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine bleed valves must be open.', 'd');
INSERT INTO `usedQuestions` VALUES(163, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'All of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(163, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'APU Fire Loop Fail', 'LAV SMOKE', 'BAGG SMOKE', 'E1(2) EXTBL A(B) INOP', 'c');
INSERT INTO `usedQuestions` VALUES(163, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'None of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(163, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'a');
INSERT INTO `usedQuestions` VALUES(164, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air leaving the pack is too hot.', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'None of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(164, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd');
INSERT INTO `usedQuestions` VALUES(164, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Forward nose hydraulic compartment.', 'Under cockpit access hatch.', 'Baggage compartment door.', 'Overwing emergency exit.', 'b');
INSERT INTO `usedQuestions` VALUES(164, 34, 'mc', 'apu', 'The sequence for shutting down the APU requires that the pilot:', 'Turn the master knob to OFF.', 'Close the APU bleed valves, wait 3 minutes, press the stop button, then turn the master knob to OFF.', 'Press the stop button, wait until 0% rotation, then turn the master knob to OFF.', 'Press the FUEL SHUTOFF button.', 'c');
