INSERT INTO `usedQuestions` VALUES(164, 7, 'mc', 'crew_awareness', 'If the CA side AHRS fails:', 'The cross-side AHRS automatically takes over.', 'The messages ATT FAIL, HDG FAIL, and HDG FAIL will be displayed on the PFD and MFD', 'Airspeed will be covered with hash marks', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'b');
