INSERT INTO `usedQuestions` VALUES(164, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'VOR approaches are impossible since the PFD is blank.', 'VOR-DME approaches can be flown using the standby instruments.', 'a');
