INSERT INTO `usedQuestions` VALUES(164, 11, 'mc', 'elec', 'Which components are energized in essential power configuration?', 'The entire electrical system.', 'DC bus 1 and DC bus 2', 'All electrical busses except the shed busses.', 'The hot battery busses, essential busses, and the central DC bus.', 'd');
INSERT INTO `usedQuestions` VALUES(164, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The GCUs, EDL and FADECs.', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'a');
INSERT INTO `usedQuestions` VALUES(164, 76, 'mc', 'elec', 'The ELT battery:', 'Is charged by the esential busses', 'Is charged by the shed buses', 'Is charged only when the ELT switch is in the ARM position.', 'Is not charged.', 'd');
