INSERT INTO `usedQuestions` VALUES(164, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You have one electrical system despite having 4 or more generators on-line.', 'You are not in the essential power configuration but should be.', 'You are in essential power configuration but should not be.', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(164, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'a');
INSERT INTO `usedQuestions` VALUES(164, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', 'a');
INSERT INTO `usedQuestions` VALUES(164, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '2', '3', '0', 'None of the above.', 'b');
INSERT INTO `usedQuestions` VALUES(164, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Shuts off all hydraulic pressure on the associated side.', 'Closes the associated hydraulic shutoff valve.', 'Has no effect on the hydraulic system.', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'b');
INSERT INTO `usedQuestions` VALUES(164, 104, 'mc', 'fire_prot', 'When a fire extinguishing handle is pulled:', 'The engine will not shut down unless the thrust lever is in idle.', 'The fuel shutoff valve closes.', 'The respective engine fire bottle is discharged.', 'All of the above.', 'b');
