INSERT INTO `usedQuestions` VALUES(164, 118, 'mc', 'flt_control', 'When using speedbrakes in flight:', 'The outboard spoilers deploy using hydraulic system 2 pressure.', 'The inboard and outboard spoilers deploy using both systems.', 'The outboard spoilers deploy using hydraulic system 1 pressure.', 'The inboard spoilers deploy using hydraulic system 1 pressure.', 'a');
INSERT INTO `usedQuestions` VALUES(164, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '18 Degrees.', '22 Degrees.', '45 Degrees.', 'B and C are correct.', 'd');
