INSERT INTO `usedQuestions` VALUES(164, 126, 'mc', 'flt_control', 'The flaps are powered by:', 'DC bus 1 & 2.', 'DC bus 1 & 2 under normal conditions; Essential buses in an electrical emergency.', 'Essential buses.', 'Hydraulic system 1 & 2.', 'a');
INSERT INTO `usedQuestions` VALUES(164, 124, 'tf', 'flt_control', 'The ground spoilers open when the airplane is on the ground, wheel speed >25 kts and a low TLA.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` VALUES(164, 140, 'mc', 'fuel', 'In essential power:', 'No fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'All fuel boost pumps are available.', 'None of the above.', 'b');
