INSERT INTO `usedQuestions` VALUES(164, 138, 'mc', 'fuel', 'If the fuel boost pump fails:', 'The engine will eventually flame out due to lack of fuel.', 'The engine will continue to run, but at reduced thrust.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'All of the above.', 'c');
