INSERT INTO `usedQuestions` VALUES(164, 160, 'mc', 'ice_rain_prot', 'When is engine lip anti-ice required?', 'Whenever the temperature is 10 C or less and visible moisture is present.', 'Whenever visible moisture is present.', 'Whenever the temperature is 10 C or less.', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(164, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'During a bleed overtemp.', 'With the FADEC Ref. anti-ice selected OFF.', 'On the ground with a wheel speed at or below 25 kts.', 'They are never inhbited.', 'c');
INSERT INTO `usedQuestions` VALUES(164, 169, 'mc', 'ice_rain_prot', 'When taxiing in icing conditions:', 'The APU bleed can be used but only for a single engine taxi, since it is on the left side of the system.', 'The engines bleeds must be open for anti-ice.', 'The APU bleed air can be used for air conditioning.', 'The APU bleed cannot be used becuase it is not hot enough for engine anti-ice.', 'c');
