INSERT INTO `usedQuestions` VALUES(164, 277, 'mc', 'radar', 'The RADAR gain knob:', 'Changes the amount of energy transmitted.', 'Changes the intensity of each color displayed.', 'Should always be turned to MAX.', 'Should always be pulled out (VAR).', 'b');
