INSERT INTO `usedQuestions` VALUES(164, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'During an SPS test.', 'If one channel of the SPS is inoperative.', 'If the airspeed is less than 200 kts.', 'If the SPS/ICE SPEEDs message is displayed.', 'b');
INSERT INTO `usedQuestions` VALUES(164, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'd');
INSERT INTO `usedQuestions` VALUES(164, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'All three bleed valves must be closed.', 'The engine bleed valves must be open.', 'The engine thrust must be at a minimum of 83% N1.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'b');
INSERT INTO `usedQuestions` VALUES(164, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'BAGG SMOKE', 'LAV SMOKE', 'APU Fire Loop Fail', 'All of the above.', 'a');
INSERT INTO `usedQuestions` VALUES(164, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'All of the above.', 'c');
INSERT INTO `usedQuestions` VALUES(164, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'The crew must ensure that no passengers are on board.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'Select "Mask" on the DAP, twist to Emergency.', 'c');
